INSERT INTO `pma_partner` VALUES (1,'dsdsa','sdsa','sad','sad','sdad','sd','12','dsa','sad'),(2,'7th Floor, ORION, Ascendas IT Park, Madhapur, Hyderabad 500081, India','Hyderabad','589778000000214818','Kantar Operations is an internal provider of market research services to the Kantar group. Their role is to identify, create and deliver world class operational solutions for Kantar?s research businesses by harnessing the combined power of technology, people and know how.Their strategy is firmly rooted in the needs of the end clients served by Kantar?s research businesses including Added Value, Millward Brown and TNS. As the custodian of Kantar?s operational strategy, we are accountable for optimising operational performance by establishing common global standards for core market research processes such as:Face to face and telephone data collection Scripting, coding, data entry and data processing Process tools, software and technical solutions Process optimisation including the interface between research and operationsMetrics and performance measurement. Centrally, they drive and develop best practice around areas such as sampling, respondent engagement and new methods of data collection such as mobile and social media. They are also responsible for leading Kantar\'s global sourcing strategy which involves the development and management of offshore and near-shore hubs.','https://pbs.twimg.com/profile_images/875670006142521345/Z7fSQxqz_400x400.jpg','Kantar Operations','50-200','','www.kantaroperations.com'),(3,'Plot No: 1,Sagar Society, Road No: 2,Banjara Hills','Hyderabad','589778000000152001','ValueMomentum provides Technology Services & Business Software to Insurance & Financial Services firms. ValueMomentum Customers like working with them because they deliver value to their initiatives, thereby, driving their momentum. ValueMomentum do this by applying a time-tested formula of combining strong technology expertise with industry experience. Their technology services offerings include Quality Assurance & Testing, Business Intelligence, SharePoint-based development, Enterprise Content Management, Application Development & Systems Integration. Their Business Software is offered as part of their Foundry family of products that addresses Product Configuration, Rating, Underwriting and Agent Portal.','https://www.valuemomentum.com/wp-content/themes/valuemomentum/assets/dist/img/refresh/logos/ValueMomentum-logo.png','ValueMomentum','More than 1000','IT','www.valuemomentum.com'),(21,'Jalagam Vegalroa Park, Punjagutta','Hyderabad','589778000000214252','Broadridge (www.broadridge.com) is a leading full-service outsourcing provider to the global financial industry, capable of meeting the most demanding requirements for efficient, secure and scalable operational support. Their reach spans the world, and encompasses an extensive array of services -- from account opening and securities transaction processing to document management and investor communications as well as full operational staff outsourcing. A steadfast source of processing support, they help financial services institutions and public companies increase productivity, streamline operations, enter new markets with new products more quickly, drive down back-office costs and better manage risk.','http://media.broadridge.com/designimages/logo.png','BroadRidge','More than 1000','IT','www.broadridge.com'),(23,'Near MCR-HRD,Plot no. 520,Road No. 27,Jubileehills','Hyderabad','589778000000301025','Indus Business Systems Limited is a software products and professional services company, continuously developing innovative technology solutions for customers. The company\'s integrated products span Life Sciences research administration and compliance from funding to trials, as well as end-to-end IT solutions. Indus strives to be a valuable partner by offering ready-to-use software products and comprehensive professional services in cutting-edge technologies, backed by years of experience.','http://www.indussoftware.com/images/indus_logo.png','Indus Business Systems Limited','50-200','IT','www.indussoftware.com'),(31,'3rd Floor, 36th Square, Road # 36, Jubilee hills','Hyderabad','589778000000141007','The LEXEL platform was created by LegalCraft Solutions, a software development firm founded in 2005 and a long-standing innovator in the legal technology industry. The company offers a wide range of products and services designed to empower legal professionals worldwide with highly efficient and effective litigation support software and evidence management solutions.\r\nHaving previously brought step-change advancements to international litigation and arbitration cases, Public Inquiries, Royal Commissions and Crown Court trials with its Transcend? transcript management software suite, LegalCraft?s LEXEL platform is poised to revolutionize the way litigators prepare cases and conduct legal proceedings worldwide. For more information visit https://lexelonline.com','https://lexelonlinecom.b-cdn.net/wp-content/uploads/2018/10/lexellogo339-x-90.png','LegalCraft Solutions (LEXEL) Pvt Ltd','50-200','IT','www.legalcraft.com / https://lexelonline.com'),(60,'3rd Floor, Chandra Reddy Towers, 100 Feet Rd, Madhapur, Hyderabad','Hyderabad','589778000000392136','Cytrion started in 2005 with a sole vision of making people\'s life easier by providing them affordable solutions through software. Cytrion was built upon the firm belief that communities of talented, driven, and principled people could move mountains. How we got to where we are now in six years is a story of smart decisions, some chaos and all in all, a remarkable journey. A company which began as a team of 4 is now an organization of 30 people rich in experience and driven by Open Source technologies, delivering cost effective applications and design solutions without compromising on quality. Please visit www.cytrion.com for more information','http://www.cytrion.com/wp-content/uploads/2015/06/dark-logo.png','Cytrion Software Solutions','10-50','','www.cytrion.com'),(75,'3rd floor, N Heights, Plot no 38, Hitech City Phase II, Madhapur, Hyderabad','Hyderabad','589778000000450005','Formerly known as TechAspect, TA Digital is a leading digital transformation agency serving organizations globally and delivering #digitalexperience, #commerce, #digitalmarketing, #digitalstrategy, #artificialintelligence solutions with superior precision. Its Digital Experience expertise has earned them a 97% customer satisfaction rating with clients ranging from Global Fortune 1000 to Mid-Market Enterprises, leading educational institutions, and Non-Profits. Regardless of industry or sector, TachAspect digital consultants will provide with customer experience, commerce, and digital marketing insights to ensure that Digital Ecosystem is ideally optimized and are realizing a maximum return on investment across its customers digital enterprise. For years, TA Digital has been a trusted partner for some of the world?s renowned organizations like Apollo Group, Avid, Celanese, Hertz, Humana, Intermec, Oracle, Paychex, Polycom, Texas Instruments and Toyota. TA Digital has offices in US, UK, and India and employs more than 400 technology professionals who bring innovative ideas to projects across all of our practices and specialties. Please visit www.tadigital.com for more information','https://www.tadigital.com/wp-content/uploads/2018/09/ta_Logo_W.png','TechAspect Solutions (TA Digital)','200-1000','IT Services','www.tadigital.com'),(88,'Building H08,Level 7,aVance BusinessHub,HitechCity','Hyderabad','589778000000494027','MAQ Software delivers innovative software solutions for Fortune 500 companies. Using the latest agile engineering techniques in a focused and disciplined manner, the company accelerates software initiatives that enable their customers to transform their industries. MAQ Software serves customers in multiple industries including technology, retail, energy, and healthcare. The company focuses on Data Analytics, Cloud, and Artificial Intelligence (AI) at our three state-of-the-art engineering centers located in Washington state and India. Leading business magazine Inc. has recognized their sustained organic growth on the Inc. 5000 list nine times as one of the fastest-growing companies (a rare honor). Please visit www.maqoftware.com for more information.','https://maqsoftware.com/img/MAQSoftware.png','MAQ Software','200-1000','IT','www.maqsoftware.com'),(94,'Building No. 14, Building No. 20, Raheja Mindspace','Hyderabad','589778000000183013','PAREXEL International is a leading global biopharmaceutical services provider, which continues to be a premier, trusted partner to clients who rely on the Company for expertise and flexibility, as well as the efficiencies of a worldwide infrastructure, to help them more quickly achieve their development and commercialization goals. For 30 years, PAREXEL has complemented client organizations with strategic insight, deep scientific knowledge, tactical expertise, and a wealth of experience throughout the development process. The Company\'s offerings include worldwide regulatory expertise, Phase I-IV clinical research services, eClinical technologies that accelerate development, and integrated commercialization services. PAREXEL is focused on providing tailored solutions that match a client\'s specific needs by applying the right blend of resources and capabilities, as well as the right guidance and high level of quality needed to help them bring safe and effective treatments to patients sooner. Headquartered near Boston, Massachusetts, PAREXEL operates in over 78 locations throughout more than 52 countries, and has over 14,400 employees worldwide.','https://pbs.twimg.com/profile_images/662632063032426497/n9eKoeFS_400x400.jpg','Parexel International India Pvt Ltd','More than 1000','IT','www.parexel.com'),(126,'6th Floor, Block B, Q City,Nanakramguda,Gachibowli','Hyderabad','589778000000585057','Headquartered in San Jose (USA), Innominds is a leading innovative solutions provider in the product engineering space. Over 450+ employees form the most agile team. We take pride in our 14 years of impeccable capability assimilated by developing diverse technology solutions and products ranging from startup innovations to mature enterprises. Innominds provide customer connected engineering and our major competencies are embedded solutions, cloud and security solutions, and technology services. Technology services include Mobility, UX & UI Engineering, Independent Testing and Open Source. Innominds offer legacy modernization and ITSM (IT Service Management) services across functions of IT departments. Innominds is one amongst the most innovative companies well known for its out-of-box thinking and the successful implementation of idea-to-release scenarios which is depicted by the creation of more than 1 billion dollars value for customers spread across varied verticals. Innominds committed to excellence and quality, strive to constantly move up the customer satisfaction curve and bring new innovations in the future.','http://www.innominds.com/hubfs/Innominds-201612/img/nav/inno-logo.png?t=1491976193056','Innominds Software Pvt. Ltd.','10-50','IT','www.innominds.com'),(174,'2B,Maximus towers,raheja IT Park','Hyderabad','589778000000709001','SumTotal is Different when they put people at the center. SumTotal roots are in learning management and that?s what makes them unique. SumTotal use the industry?s only Context-Aware technology to provide information and actions that matter when and where they matter. SumTotal focus exclusively on HR.SumTotal have nearly 30 years? experience helping our customers create great places to work. SumTotal is currently the largest independent human resources (HR) vendor in the industry with global scale and reach. SumTotal are first in market share in learning management systems (LMS) and third in Talent Management behind the two biggest enterprise resource planning (ERP) companies in the world. Many of the world\'s \"Greatest Places to Work\" turn to SumTotal for Learning, Talent, Workforce, Payroll and Expense Management solutions.','https://pbs.twimg.com/profile_images/712653723219136512/hb0oi2zm_400x400.jpg','SumTotal Systems','200-1000','IT','http://www.sumtotalsystems.com/'),(183,'1-90/B/C/4/A, 3rd Floor, DSR Corporate Centre, Plot No 1&2, Patrika Nagar, Madhapur','Hyderabad','589778000000215012','Vistex is the global leader in pricing, contract, incentive management and channel marketing solutions and services, providing unprecedented visibility into the breadth and depth of go-to-market programs and enabling businesses with insightful information that drive revenue, control costs and increase margins. Deployed on-premise and in the cloud, Vistex serves businesses of all sizes worldwide across a spectrum of industries. With an unwavering commitment to its clients, the world?s best run organizations choose Vistex to manage master data, contracts, pricing, rebates, incentives and channel programs, ensuring success from inception to insight','https://pbs.twimg.com/profile_images/575297929214189568/WiCFbCLV_400x400.png','Vistex Asia Pacific Pvt Ltd','200-1000','IT','www.vistex.com'),(199,'8-2-120/113, I Floor, \"Sanali Info Park\" Road No-2','Hyderabad','589778000000209113','NextSphere is a software services firm that develops, manages, hosts, and maintains applications for companies in a wide range of industries. Our industry-certified solutions offer clients market-leading competitive advantages gained through expedited time to market and the cost savings afforded by a global delivery model that leverages our state-of-the-art development facilities in multiple time zones. Please visit www.nextsphere.com for more information','https://www.nextsphere.com/Content/img/whitebg-logo.png','NextSphere Technologies','200-1000','IT','www.nextsphere.com'),(204,'H.No. 3-42-41,II Floor,Samrat Clny,West Maredpally','Hyderabad','589778000000215388','Vicisoft specialises in information management solutions to structure unstructured content like images, forms, emails and documents for medium and large enterprises. In 2000 a team of highly educated professionals found each other and bundled their knowledge to bring their vision alive in the Vicisoft Enterprise Pro solution. The experience has shaped the solution to one of the top players in today?s Enterprise Content Management (ECM) and Business Process Management (BPM) market with a proven track record.  The company\'s flagship product is Vicisoft Enterprise Pro, an integrated document management system, that has established a prestigious client list in various verticals like Financial Services, Construction, Logistics, E-governance etc.\r\nWith almost 15 years of experience and a global customer base Vicisoft will increase your efficiency and productivity by streamlining your organisation. The company\'s solutions enable organizations to cut turnaround time and cost, automate business processes and improve employee productivity through document imaging and workflow solutions. The product\'s flexible and scalable architecture adapts easily to the existing IT infrastructure - from a small department application to the enterprise level. For more information visit www.vicisoft.com\r\n','https://pbs.twimg.com/profile_images/2024447049/Vicisoftlogo_400x400.jpg','Vicisoft Technologies','10-50','','www.vicisoft.com'),(239,'Phase l, 1st Floor Cyber Pearl, HiTech City','Hyderabad','589778000000798029','MetrixLab provides consumer insights that drive smarter business decisions. As a truly digital global research agency, MetrixLab pioneer new technologies and integrate multiple data sources to push the boundaries of research. This enables Its experts to provide high-quality insights at scale, at speed and for an unparalleled value. MetrixLab has grown rapidly and now work with more than half of the world?s top 100 brands. MetrixLab is part of the Macromill Group. Please visit www.metrixlab.com for more information','https://www.metrixlab.com/new/wordpress/wp-content/uploads/2016/06/logo-metrix-vacances.png','MetrixLab','200-1000','Market Research','www.metrixlab.com'),(242,'Door No 6-3-1091/C/1, Fortune 9, Opposite Yashoda Hospital, Raj Bhavan Road','Hyderabad','589778000000171039','ADP is one of the largest providers of business processing and cloud-based solutions including human resources, payroll, benefits and talent management to employers and automotive dealerships around the world. They build configurable solutions that can fit the organizations unique goals and increase productivity. ADP serves about 600,000 organizations in more than 125 countries, including 425,000 small-business clients and 26,000 vehicle dealerships. Over 80 percent of FORTUNE 500 companies and more than 90 FORTUNE 100 companies use at least one of ADPs services.Partnering with ADP means you get solutions with the latest technology ? so you can focus the limited time and resources on their clients business, not back-office administration.','https://www.adp.com/-/media/USA-2015/Global-Header/logo_ADP_red.ashx?la=en&hash=62C692F1D05DA5BDB8982DC63E16E9077954C906','ADP Private Limited','More than 1000','IT','www.adp.com'),(245,'White house,Kundenbagh, Begumpet','Hyderabad','589778000000830001','Ad3I is a Software Services and Development company serving their clients by providing reliable and consistent services and developing robust, cutting-edge products at a faster pace. Ad3I mantra is great quality, fast development and 100% dependable deliveries. With headquarters in the US and India, AD3i Systems Inc supports industry leading distribution firms, TPAs and insurance carriers and provides effective state-of-the-art technology solutions designed exclusively for the financial and healthcare industries. Using the latest technologies including .Net, Java, C++, IOS, Android, Hybrid (Cordova, Telerik, etc), AWS, Azure and more, AD3i Systems Inc has the unique domain expertise, the proven project methodologies and the knowledge and training needed. Please visit http://www.ad3i.com for more information.','http://www.ad3i.com/wp-content/uploads/2017/01/Logo_Dark_50px-1.png','AD3I Software Solutions Pvt Ltd','50-200','IT','http://www.ad3i.com'),(256,'5th Floor, Queens Plaza, Begumpet','Hyderabad','589778000000856001','NCR Corporation (NYSE: NCR) is the global leader in consumer transaction technologies, turning everyday interactions with businesses into exceptional experiences. With its software, hardware, and portfolio of services, NCR enables more than 450 million transactions daily across the retail, financial, travel, hospitality, telecom and technology industries. NCR solutions run the everyday transactions that make your life easier.NCR is headquartered in Duluth, Georgia with 30,000+ employees and does business in 180+ countries. NCR is a trademark of NCR Corporation in the United States and other countries.Please visit Website: www.ncr.com for more information','https://www.ncr.com/etc/clientlibs/ncrcom-aem-project/main/images/ncr_nav_logo180.png','NCR Corporation','More than 1000','IT','www.ncr.com'),(274,'WaveRock SEZ  Level 1, Part B of Tower 1-Phase 2 S','Hyderabad','589778000000902005','M3bi is a next generation IT Services Company specializing in Digital, Data and Analytics, started its operations in year 2010 by a group of technocrats. It?s headquarter is based at Scottsdale, AZ, USA with Offshore development center in India at Hyderabad and Pune. Offshore development centers are appraised at Capability Maturity Model Integration CMMI-DEV V 1.3 (Staged) Level 3 (Defined) as per SCAMPI and are ISO 27001:2013 certified. Both CMMI appraisal and ISO 27001:2013 certification is a testimony to our commitment on providing efficient solutions/services to customers through continual improvement following world recognized Information Security Standard. \r\n\r\nM3bi focus is on providing niche and cus