Intellect suite is the largest in the industry. With cutting-edge products driving value in over 250 financial institutions in 30 countries, Intellect is resolutely customer centric. For more information, visit www.intellectdesign.com','https://pbs.twimg.com/profile_images/946692810731749376/yau3l4kB_400x400.jpg','Intellect Design Arena','More than 1000','IT Product Dev','www.intellectdesign.com'),(1225,'Gvr towers Yellareddyguda, Hyderabadnull','Hyderabad','8a670e5c-b360-42f8-833e-b9550ff557ab','ForSmart innovation Solutions (P) Ltd is a startup and have a team of 7 people as of now. ForSmart made its humble beginning in March 2018 by providing services to few of their clients in U.S.A. ForSmart specialize in implementing Oracle Cloud Enterprise Solutions specific to Supply Chain Management. ForSmart is in the process of expanding its technical and product development team to build hybrid mobile applications for their customers on IoT.',NULL,'ForSmart Innovations Solutions (P) Ltd','0 - 500','IT Services','https://forsmart-innovations-solutions-private.business.site'),(1226,'Indian Institute Of Technology (IITH), C- Block, 702, IIT Hyderabad.Kandi, Sangareddy','Sangareddy','1fa5cb1a-d50c-4297-a7f2-ac93f8050447','Plianto Technologies build comprehensive Enterprise Resource Planning (ERP) solutions that automate the management processes of higher education and research institutes, which offers highly configurable and adaptable software. Plianto offers an intelligent and cost-effective solution to aptly address the various management issues of various institutions. Plianto team has a rich experience in the field of software engineering, having designed and developed several complex products for various IT firms and the government. For more information, please visit http://www.plianto.com','http://www.plianto.com/images/logo.png','Plianto Technologies Pvt Ltd','10-50','IT Product Dev','http://www.plianto.com/'),(1230,'Hitechcity Hyderabad null','Hyderabad','25b12164-c6ff-4987-aac1-6ae8ef0ffb93','Technomax is a non-traditional and market disruptive technology consulting firm that is focused on challenging the status quo of how IT is delivered. TMX, with its emerging technology partnerships, aggressive pricing strategies, optimized delivery models inclusive of onsite; onshore; and offshore; and entrepreneurial mindset can rapidly deploy solutions and teams to ensure client success. TMX excels in delivering Data Management, Risk and Compliance, Application Development, and Infrastructure Development services and solutions. Visit http://www.technomaxllc.com/ for more information','http://www.technomaxllc.com/wp-content/uploads/2017/12/logo-wp-7.png','Technomax LLC','50-200','IT Services','https://www.technomaxllc.com'),(1231,'Plot.No.3-164,Block B,Survey #48,3rd Floor,Eashan- Arcade,Kavuri Hills,Gutlabegumpet Village,Madhapurnull','Hyderabad','7ad6236c-62a1-4432-9725-9b8e9cb5156f','Develgram Technologies is an IT Software Development company, providing design and development solutions to group of companies all across the globe. Develgram specialize in web, windows, open source and mobile app development across any domain, helping clients to solve complex business challenges. Being a technology driven company, their team primarily consists of designers and developers. Over the years Develgram have helped clients build great applications for various platforms\r\nStarted in 2017 with a vision to be a quality one-stop development company, Develgram Technologies is happy to receive the positive accolades from all our clients and partners. Every single project is streamlined and closely monitored by our development and management team following well-defined processes and stringent quality testing.  Visit http://www.develgramtech.com for more information','https://media.licdn.com/dms/image/C510BAQGglzzbQn2iow/company-logo_400_400/0?e=1579737600&v=beta&t=W5PtQPjrqI4_lLD5OAYoSKVa4fzgUftGYRppCgxynBQ','Develgram Technologies Pvt Ltd','1-10','IT Product Dev','http://www.develgramtech.com/'),(1232,'7th Floor, MSR Block, Krishe Sapphire Building, Survey no. 88, Madhapurnull','Hyderabad','fb47b780-3522-4035-b659-e95d8aa386b9','Randstad India is a wholly-owned subsidiary of Randstad Holding nv, a ? 23.3 billion global provider of HR services. Through its unique approach of delivering HR innovation with human interaction at the center, Randstad focuses on creating success for people and organizations by giving the right person the right job and at the right time through a combination of high-tech and high-touch processes. As a trusted partner in the post-digital world of talent, Randstad advances the careers and business success of our candidates and clients. Please visit www.randstad.in','https://pbs.twimg.com/profile_images/912230082365632512/kdhtloqx_400x400.jpg','Randstad India Limited','200-1000','IT Services','www.randstad.in'),(1233,'FNO-202, J D Arcade, Begumpet, Hyderabadnull','Hyderabad','a96995e5-5b3d-49d0-bbe3-c225e9a33b0a','Streamline CPQ is a global leader in CPQ implementations and services. Its expert design team with over a century of collective experience has been serving and providing thought leadership to some of the largest CPQ clients in the world. From complex platform integrations to automation testing, project management to staff augmentation. Streamline CPQ provide a 360 degree suite of services to increase your ROI and streamline the CPQ experience. Please visit www.streamlinecpq.com for more information','https://images.squarespace-cdn.com/content/5452d1d7e4b09e40901487ab/1561417735393-BJXU6K5UCHA1UFXQIJ6H/SLCPQ_LOGO_SITE.png?content-type=image%2Fpng','Streamline CPQ','10-50','IT Services','https://www.streamlinecpq.com/');
